function transformarNumerosEmLinks(node) {

  const phoneRegex = /(?:\+55\s?)?\(?\d{2}\)?[\s-]?\d{4,5}-\d{4}/g;
  const ignoreTags = ['SCRIPT', 'STYLE', 'TEXTAREA', 'INPUT'];

  // Etapa 1: coleta segura dos nós de texto
  const textNodes = [];
  const walker = document.createTreeWalker(node, NodeFilter.SHOW_TEXT, null, false);
  let currentNode;
  while ((currentNode = walker.nextNode())) {
    const parentTag = currentNode.parentNode.tagName;
    if (!ignoreTags.includes(parentTag)) {
      textNodes.push(currentNode);
    }
  }

  // Etapa 2: processa os nós
  textNodes.forEach((textNode) => {
    const originalText = textNode.nodeValue;
    const matches = [...originalText.matchAll(phoneRegex)];

    if (matches.length > 0) {
      const span = document.createElement("span");
      let lastIndex = 0;

      matches.forEach((match) => {
        const [fullMatch] = match;
        const index = match.index;

        // Texto antes do match
        span.appendChild(document.createTextNode(originalText.substring(lastIndex, index)));

        // Texto do número
        span.appendChild(document.createTextNode(fullMatch));

        // Normaliza o número para só os dígitos
        const digits = fullMatch.replace(/\D/g, '');
        const fullNumber = digits.startsWith('55') ? digits : '55' + digits;

        const icon = document.createElement("img");
        //icon.src = "https://img.icons8.com/ios-filled/20/25D366/whatsapp.png";
        icon.src = "data:image/png;base64,";
		icon.style.width = "20px";
		icon.style.height = "20px";
		icon.alt = "WhatsApp";
        icon.style.cursor = "pointer";
        icon.style.marginLeft = "5px";
		icon.style.verticalAlign = "text-bottom";
		//icon.style.position = "relative";
		//icon.style.top = "2px";

        icon.title = `Abrir no WhatsApp: +${fullNumber}`;

        icon.addEventListener("click", () => {
          window.open(`https://wa.me/+${fullNumber}`, "_blank");
        });

        span.appendChild(icon);

        lastIndex = index + fullMatch.length;
      });

      // Texto depois do último número
      span.appendChild(document.createTextNode(originalText.substring(lastIndex)));

      // Substitui o nó de texto original pelo novo span
      textNode.parentNode.replaceChild(span, textNode);
    }

  });
}

	// Compatibilidade com Firefox + Chrome
	const storage = (typeof browser !== "undefined" ? browser.storage : chrome.storage);

	window.addEventListener("load", () => {
	  storage.sync.get(["showIcons"], (data) => {
		if (data.showIcons !== false) {
		  transformarNumerosEmLinks(document.body);
		}
	  });
});
